import React from "react";
import TreeView from "@mui/lab/TreeView";
import { styled } from "@mui/material/styles";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import ChevronRightIcon from "@mui/icons-material/ChevronRight";
import TreeItem from "@mui/lab/TreeItem";
import { Grid } from "@mui/material";

const StyledTreeView = styled(TreeView)({
  height: 240,
  flexGrow: 1,
  maxWidth: 400,
});

export default function FileSystemNavigator() {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        {/* Árbol */}
        <StyledTreeView
          defaultCollapseIcon={<ExpandMoreIcon />}
          defaultExpandIcon={<ChevronRightIcon />}
        >
          <TreeItem nodeId="animalia" label="Animalia">
            <TreeItem nodeId="filo1" label="Acanthocephala">
              <TreeItem nodeId="clase1" label="Clase">
                <TreeItem nodeId="orden1" label="Orden">
                  <TreeItem nodeId="familia1" label="Familia">
                    <TreeItem nodeId="genero1" label="Género">
                      <TreeItem nodeId="especie1" label="Especie" />
                    </TreeItem>
                  </TreeItem>
                </TreeItem>
              </TreeItem>
            </TreeItem>
            <TreeItem nodeId="filo2" label="Annelida">
              {/* Agrega más nodos de Annelida aquí */}
            </TreeItem>
            <TreeItem nodeId="filo3" label="Arthropoda">
              {/* Agrega más nodos de Arthropoda aquí */}
            </TreeItem>
            {/* Agrega más nodos de Animalia aquí */}
          </TreeItem>
          <TreeItem nodeId="fungi" label="Fungi">
            {/* Agrega más nodos de Fungi aquí */}
          </TreeItem>
          <TreeItem nodeId="moner" label="Moner">
            {/* Agrega más nodos de Moner aquí */}
          </TreeItem>
          <TreeItem nodeId="plantae" label="Plantae">
            {/* Agrega más nodos de Plantae aquí */}
          </TreeItem>
          <TreeItem nodeId="protista" label="Protista">
            {/* Agrega más nodos de Protista aquí */}
          </TreeItem>
        </StyledTreeView>
      </Grid>
    </Grid>
  );
}
